import React, { useState } from "react";

function App() {
  const state = useState()
  let likes = 0
  return (
    <div className="App">
     <h1>{likes}</h1>
     <button onClick={() => likes += 1}>Increament</button>
     <button onClick={() => likes -= 1}>Decreament</button>
    </div>
  );
}

export default App;
